import './App.css';
import Appbar from './components/Appbar';
import Paper from '@mui/material/Paper';
import React, { useState, useEffect } from 'react';
import TextField from '@mui/material/TextField';
import FormControl from '@mui/material/FormControl';
import { Theme, useTheme } from '@mui/material/styles';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import Select, { SelectChangeEvent } from '@mui/material/Select';

const Result = () => {

  const [deps, setDeps] = useState([]);
  useEffect(() => {
    fetch('http://localhost:8080/search/deps')
      .then(response => response.json())
      .then(data => {
        const departmentsData = data.map(departmentName => ({
          value: departmentName,
          label: departmentName
        }));

        // Add the "All" department option
        departmentsData.push({
          value: 'all',
          label: 'All'
        });

        setDeps(departmentsData);
      })
      .catch(error => {
        console.error('Error fetching departments:', error);
      });
  }, []);


  const [department, setDepartment] = useState('');
  const [func, setFunc] = useState('');
  const [application, setApplication] = useState('');
  const [menu, setMenu] = useState('');
  const [fileName, setFileName] = useState('');
  const [fileType, setFileType] = useState('');
  const [desc, setDesc] = useState('');
  const [auth, setAuth] = useState('');
  // const [file, setFile] = useState(null);

  const ITEM_HEIGHT = 48;
  const ITEM_PADDING_TOP = 8;
  const MenuProps = {
    PaperProps: {
      style: {
        maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
        width: 250,
      },
    },
  };

  const handleSubmit = () => {
    // Create a FormData object to store the form data
    const formData = new FormData();
    formData.append('departmentName', department);
    formData.append('functionName', func);
    formData.append('applicationName', application);
    formData.append('menuName', menu);
    // formData.append('file', file);
    formData.append('fileName', fileName);
    formData.append('fileType', fileType);
    formData.append('description', desc);
    formData.append('author', auth);

    // Make a POST request to the backend with the form data
    fetch('http://localhost:8080/add', formData)
      .then(response => {
        // Handle the response
        console.log('Data uploaded successfully:', response.data);
        // Reset the form fields
        setDepartment('');
        setFunc('');
        setApplication('');
        setMenu('');
        setFileName('');
        setFileType('');
        setDesc('');
        setAuth('');
        // setFile(null);
      })
      .catch(error => {
        // Handle the error
        console.error('Error uploading data:', error);
      });
  };

  return (
    <div>
      <div> <Appbar className="App"/> </div>
      <h1>Upload Page</h1>
      <form onSubmit={handleSubmit}>
        <div style={{display : 'grid', gridTemplateColumns : '3fr 1fr'}}>
        <FormControl sx={{ m: 1, width: 300 }}>
            <InputLabel id="demo-multiple-name-label">Select Department</InputLabel>
            <Select
              labelId="demo-multiple-name-label"
              id="demo-multiple-name"
              select
              onChange={e => setDepartment(e.target.value)}
              input={<OutlinedInput label="Name" />}
              MenuProps={MenuProps}
            >
              {deps.map((name) => (
                <MenuItem
                  key={name.value}
                  value={name.value}
                >
                  {name.label}
                </MenuItem>
              ))}
            </Select>
          </FormControl>
          <label>Department:</label>
          <input type="text" value={department} onChange={e => setDepartment(e.target.value)} />
        </div>
        <div>
          <label>Function:</label>
          <input type="text" value={func} onChange={e => setFunc(e.target.value)} />
        </div>
        <div>
          <label>Application:</label>
          <input type="text" value={application} onChange={e => setApplication(e.target.value)} />
        </div>
        <div>
          <label>Menu:</label>
          <input type="text" value={menu} onChange={e => setMenu(e.target.value)} />
        </div>
        {/* <div>
          <label>File:</label>
          <input type="file" onChange={e => setFile(e.target.files[0])} />
        </div> */}

        <button type="submit">Upload</button>
      </form>
    </div>
  );
};

export default Result;
